INSERT INTO `item_metas` VALUES (1,'attribute','{\n   \"weight\" : \"250gms\"\n }','2023-09-12 16:15:42.664000','2023-09-12 16:18:20.654000','2023-09-12 16:18:20.642000',7,7),(2,'job_html','{\n  \"html\": \"<div> <p><b>Job Description:</b></p> <p>You will be part of the team which partners with the business leaders to provide data-driven strategies to grow business KPIs like acquisition, customer engagement & retention, campaign optimization, personalized offering, etc.</p> <p>Leverage all the traditional and alternate data sources like credit bureau, digital data, partner data, social media, and banking data to develop impactful strategies to drive business goals for marketing/product/customer/collections</p> <p>Analyze large amounts of data and build solutions based on insights captured from data</p> <p>Innovate with a focus on developing newer and better approaches using big data & machine learning solutions</p> <p>Develop portfolio MIS and track the portfolio performance and recommend a course of action</p> <p>Align closely with the client\'s business teams to deliver on the business goals through strong analytics-driven strategies.</p>  <p><b>Role:</b> Analytics - Senior Analyst</p> <p><b>Industry Type:</b> IT Services & Consulting</p> <p><b>Department:</b> Data Science & Analytics</p> <p><b>Employment Type:</b> Full Time, Permanent</p> <p><b>Education:</b> Masters or Bachelor\'s in Computer Science, Mathematics, Statistics, or Engineering</p> <p><b>Experience Required:</b> 3-6 years</p> <p><b>Location: Chennai</p> </div> \"\n}','2023-09-14 11:11:23.150000','2023-09-14 11:11:25.464000','2023-09-14 11:11:25.459000',7,7),(3,'scl_html','{\"html\":\"<div><p><b>Scholarship Details:</b></p><p>Scholarship amount: Rs. 50,000 scholarship overall</p>   <p>Eligibility criteria: CAT/XAT Scores greater than or equal to 80% percentile, and MAT Scores greater than or equal to 90% percentile + throughout 1st division in 10th, 12th, and UG</p></div>\"}','2023-09-14 11:45:22.118000','2023-09-14 11:45:23.817000','2023-09-14 11:45:23.813000',7,7),(4,'scl_html','{\n   \"html\" : \"<div>    <p><b>Scholarship Details:</b></p>    <p>Pass in BE / BTech in a relevant branch from a recognized University, with minimum 50% aggregate marks or equivalent</p>    <p>Eligibility Criteria: The candidate MUST be having the Manipal Entrance Test (MET) Rank for MTech / ME program</p>    <p>The scholarship involves a 20% waiver of the Course fee for the candidates admitted to the program under the GENERAL category</p></div>\"\n\n }','2023-09-15 10:45:08.552000','2023-09-15 10:45:09.976000','2023-09-15 10:45:09.972000',7,7),(5,'CRS_HTML','{\n   \"html\" : \"<div>    <p><b>About the course:</b> BRDS offers different Coaching programs for both UG and PG programs. Students can enroll for Regular or Weekend or Crash Courses as per their academic schedules.</p>    <p><b>Course details:</b></p>    <p>Course Provider: Bhanwar Rathore Design Studio</p>    <p>Course Length: 6 months/ 1 year</p>    <p>Schedule: Regular/ Weekend</p>    <p>Course delivery: Online</p></div>\"\n\n }','2023-09-15 10:57:00.829000','2023-09-15 10:57:08.121000','2023-09-15 10:57:08.117000',7,7),(6,'html','<body>\n    <h1>About the Product:</h1>\n    <p><strong>MANUFACTURER:</strong> Cipla Ltd</p>\n    <p><strong>SALT COMPOSITION:</strong> Cetirizine (5mg) + Paracetamol (325mg) + Phenylephrine (10mg)</p>\n    <p><strong>STORAGE:</strong> Store below 30°C</p>\n\n    <h2>Uses:</h2>\n    <p>Cheston Cold Tablet is used in the treatment of common cold symptoms like runny nose, stuffy nose, sneezing, watery eyes, and congestion or stuffiness. It is also used to relieve pain and fever.</p>\n\n    <h2>How it works:</h2>\n    <p>Cheston Cold Tablet is a combination of three medicines: Cetirizine, Paracetamol, and Phenylephrine, which relieves common cold symptoms. Cetirizine is an antiallergic that blocks histamine (a chemical messenger) to relieve allergy symptoms like runny nose, watery eyes, and sneezing. Paracetamol is an analgesic (pain reliever) and antipyretic (fever reducer). It blocks the release of certain chemical messengers in the brain that are responsible for pain and fever. Phenylephrine is a decongestant that narrows the small blood vessels, providing relief from congestion or stuffiness in the nose.</p>\n\n    <h2>Common side effects:</h2>\n    <ul>\n        <li>Nausea</li>\n        <li>Vomiting</li>\n        <li>Headache</li>\n        <li>Fatigue</li>\n        <li>Dizziness</li>\n        <li>Dryness in mouth</li>\n        <li>Sleepiness</li>\n        <li>Allergic reaction</li>\n    </ul>\n</body>','2023-09-22 07:06:15.686000','2023-09-22 07:06:18.141000','2023-09-22 07:06:18.137000',7,7),(7,'html','\"<div>\n    <p><b>Scholarship Details:</b></p>\n    <p>Postgraduation level students Rs. 1800 per month for girls and Rs. 1500 per month for boys</p>\n    <p>Eligibility Criteria: The applicant ought to be enrolled in a master’s program.</p>\n    <p>In the most recent qualifying exam, male applicants needed to obtain a minimum score of 65%, and female applicants needed a minimum score of 60%.</p>\n    <p>For the Sitaram Jindal foundation scholarship, Karnataka students must receive at least 70% for boys and 65% for girls.</p>\n</div>\n\"','2023-09-27 07:45:14.768000','2023-09-27 07:45:16.826000','2023-09-27 07:45:16.821000',7,7),(8,'html','<div>\n    <p><b>Job Description:</b></p>\n    <p>Strong knowledge of .NET web framework and Front-end frameworks like Angular or react.</p>\n    <p>Proficient in ASP.NET MVC, .NET CORE, with a good knowledge of their ecosystems.</p>\n    <p>Familiarity with the Mono framework.</p>\n    <p>Strong understanding of object-oriented programming.</p>\n    <p>Skill for writing reusable libraries.</p>\n    <p>Familiar with various design and architectural patterns.</p>\n    <p>Knowledge of concurrency patterns.</p>\n    <p>Familiarity with Microsoft SQL Server and popular web application frameworks.</p>\n    <p>Knack for writing clean, readable, and easily maintainable code.</p>\n    <p>Understanding of fundamental design principles for building a scalable application.</p>\n    <p>Experience creating database schemas that represent and support business processes.</p>\n    <p>Experience implementing automated testing platforms and unit tests.</p>\n    <p>Proficient understanding of code versioning tools.</p>\n    <p>Knowledge of Azure DevOps is a plus.</p>\n    \n    <p><b>Role:</b> Risk Advisory Data Analyst</p>\n    <p><b>Industry Type:</b> Accounting / Auditing</p>\n    <p><b>Department:</b> Finance</p>\n    <p><b>Employment Type:</b> Full Time, Permanent</p>\n    <p><b>Education:</b> B.Tech/B.E. in Production/Industrial, BCA in Computers, Any Postgraduate</p>\n    <p><b>Experience Required:</b> 0-1 years</p>\n    <p><b>Location: New Delhi</p>\n</div>','2023-09-27 16:27:45.291000','2023-09-27 16:27:47.031000','2023-09-27 16:27:47.027000',8,8),(9,'html','<div>\n    <p><b>Scholarship Details:</b></p>\n    <p>Scholarship amount: Rs. 50,000 scholarship overall</p>\n    <p>Eligibility criteria: CAT/XAT Scores greater than or equal to 80% percentile, and MAT Scores greater than or equal to 90% percentile + throughout 1st division in 10th, 12th, and UG</p>\n</div>\n','2023-09-29 14:18:21.373000','2023-09-29 14:28:26.606000','2023-09-29 14:28:12.458000',7,7),(10,'html','<div>\n    <p><b>Scholarship Details:</b></p>\n    <p>Pass in BE / BTech in a relevant branch from a recognized University, with minimum 50% aggregate marks or equivalent</p>\n    <p>Eligibility Criteria: The candidate MUST be having the Manipal Entrance Test (MET) Rank for MTech / ME program</p>\n    <p>The scholarship involves a 20% waiver of the Course fee for the candidates admitted to the program under the GENERAL category</p>\n</div>','2023-09-29 14:53:28.849000','2023-09-29 14:53:31.656000','2023-09-29 14:53:31.652000',7,7),(11,'html','<div>\n    <p><b>Scholarship Details:</b></p>\n    <p>Selected candidates will recei