INSERT INTO `items` VALUES (1,'java springboot book','java springboot book','JSB','java springboot book','2023-09-11 16:29:34.066000','2024-04-17 06:20:06.047000','2023-09-11 16:29:35.439000',7,20,NULL,NULL),(2,'T Shirt','Elevate your casual style with this vibrant blue polo t-shirt adorned with subtle stripes.','TSH','Elevate your casual style with this vibrant blue polo t-shirt adorned with subtle stripes. Crafted from soft and breathable cotton fabric, it offers both comfort and a touch of sophistication. The classic collar and short sleeves ensure a timeless look, perfect for pairing with jeans or chinos for a relaxed yet refined ensemble.','2023-09-13 06:22:28.006000','2024-03-29 16:34:45.654000','2023-09-13 06:22:31.529000',7,7,NULL,NULL),(3,'Jean','Mens Jeans','MJN','Men\'s jeans from MAX','2023-09-13 06:24:25.505000','2023-09-13 06:24:28.554000','2023-09-13 06:24:28.549000',7,7,NULL,NULL),(4,'Node course','Node course','NDC','Node course by Edureka','2023-09-13 06:26:20.283000','2024-04-16 09:34:29.011000','2023-09-13 06:26:25.762000',7,20,NULL,NULL),(5,'Cardiology specialist','cardiology','CRD-1','cardiology','2023-09-13 10:35:07.718000','2023-09-15 11:24:30.867000','2023-09-13 10:35:11.554000',7,7,NULL,NULL),(6,'Analytics - Senior Analys',NULL,NULL,'\"Job Description:\n\nYou will be part of the team which partners with the business leaders to provide data driven strategies to grow business KPIs like acquisition, customer engagement & retention, campaign optimization, personalized offering, etc.\nLeverage all the traditional and alternate data sources like credit bureau, digital data, partner data, social media and banking data to develop impactful strategies to drive business goals for marketing/product/customer/collections\nAnalyse large amounts of data and build solutions based on insights captured from data\nInnovate with a focus on developing newer and better approaches using big data & machine learning solution\nDevelop portfolio MIS and track the portfolio performance and recommend course of action\nAlign closely with the client\'s business teams to deliver on the business goals through strong analytics driven strategies.\n\nRole: Analytics - Senior Analyst\nIndustry Type: IT Services & Consulting\nDepartment: Data Science & Analytics\nEmployment Type: Full Time, Permanent\nEducation: Masters or Bachelor\'s in Computer Science, Mathematics, Statistics or Engineering\nExperience Required: 3-6 years\nLocation: Chennai\"\n','2023-09-14 11:06:16.638000','2024-04-15 13:40:32.622000','2024-04-05 09:13:14.607000',7,20,NULL,NULL),(7,'MS Ramaiah Memorial Scholarship','The Ramaiah University of Applied Sciences rewards excellence with scholarships. Students can choose to apply for a Merit Scholarship (that is, either a Scholarship of Distinction or a Scholarship of Excellence) or an Admission Test Scholarship',NULL,'\"Scholarship Details:\nScholarship amount: Rs. 50,000 scholarship overall\n\nEligibility criteria: CAT/XAT Scores grater than or equal to 80% percentile, and MAT Scores greater than or equal to 90% percentile + throughout 1st division in 10th, 12th and UG\"','2023-09-14 11:19:27.993000','2024-04-26 09:27:45.956000','2023-09-14 11:19:48.437000',7,20,NULL,NULL),(8,'MAHE Scholarships','\"MAHE Manipal offers Merit scholarships to meritorious students admitted to the Master of Technology (MTech) / Master of Engineering (ME) program at Manipal Institute of Technology (MIT) Manipal and Manipal School of Information Sciences (MSIS) Manipal\"',NULL,'\"Scholarship Details: \nPass in BE / BTech in a relevant branch from a recognized University, with minimum 50 % aggregate marks or\nequivalent\n\nEligibility Criteria: The candidate MUST be having the Manipal Entrance Test (MET) Rank for MTech / ME program\nThe scholarship involves a 20 % waiver of the Course fee for the candidates admitted to the program under the GENERAL category\"','2023-09-15 10:40:57.396000','2023-09-15 10:41:29.503000','2023-09-15 10:41:29.499000',7,7,NULL,NULL),(9,'NIFT Coaching','BRDS provides Offline, Live Online and Hybrid Coaching Classes for NIFT Entrance Exam 2024-2025. ','NIFT','\"About the course:\nBRDS offers different Coaching programs for both UG and PG programs. Students can enroll for Regular or Weekend or Crash Courses as per their academic schedules.\n\nCourse details:\nCourse Provider: Bhanwar Rathore Design Studio)\nCourse Length: 6 months/ 1 year\nSchedule: Regular/ Weekend\nCourse delivery: Online\"','2023-09-15 10:53:30.701000','2023-09-15 10:53:33.613000','2023-09-15 10:53:33.608000',7,7,NULL,NULL),(10,'Cheston Syrup','Cheston Cold Tablet is used in the treatment of common cold symptoms ','CSS','About the Product:\nMANUFACTURER- Cipla Ltd\nSALT COMPOSITION - Cetirizine (5mg) + Paracetamol (325mg) + Phenylephrine (10mg)\nSTORAGE - Store below 30°C\n\nUses:\nCheston Cold Tablet is used in the treatment of common cold symptoms like runny nose, stuffy nose, sneezing, watery eyes, and congestion or stuffiness. It is also used to relieve pain and fever..\n\nHow it works\nCheston Cold Tablet is a combination of three medicines: Cetirizine, Paracetamol and Phenylephrine, which relieves common cold symptoms. Cetirizine is an antiallergic which blocks histamine (a chemical messenger) to relieve allergy symptoms like runny nose, watery eyes and sneezing. Paracetamol is an analgesic (pain reliever) and antipyretic (fever reducer). It blocks the release of certain chemical messengers in the brain that are responsible for pain and fever. Phenylephrine is a decongestant which narrows the small blood vessels providing relief from congestion or stuffiness in the nose.\n\nCommon side effects\nNausea, Vomiting, Headache, Fatigue, Dizziness, Dryness in mouth, Sleepiness, Allergic reaction','2023-09-22 05:39:33.146000','2024-01-09 08:54:48.014000','2023-09-22 05:39:36.200000',7,NULL,NULL,NULL),(11,'Lipid Profile ','A Lipid Profile test, also known as a total cholesterol test, is done to measure the amount and type of fat in the blood.',NULL,'About the Test\nA Lipid Profile test, also known as a total cholesterol test, is done to measure the amount and type of fat in the blood. It measures low-density lipoprotein (LDL), high-density lipoprotein (HDL), and triglycerides in the body.. People with obesity, diabetes, a sedentary lifestyle, and a family history of high cholesterol or heart attacks should regularly get their lipid profile testing done. People undergoing treatment for high cholesterol and heart disease also require regular cholesterol testing to monitor the effectiveness of treatment, It is crucial to establish an accurate diagnosis of a lipid profile to proactively eliminate the risks of stroke or major cardiovascular diseases.\n\nTest preparation\n1. Fast for at least 10–12 hours before the test. Fasting means neither eating any food nor drinking coffee, tea, milk, tender coconut water or anything except water.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 8-9 hours\n\nParameters Considered\n1. The Lipid Profile test usually measures total cholesterol, HDL cholesterol, LDL cholesterol, and triglycerides levels. The other results that may be reported include derived VLDL cholesterol, derived non-HDL cholesterol, and total cholesterol to HDL cholesterol ratio.\n2.Cholesterol and triglycerides are essential lipids that are carried in the blood by lipoprotein particles made up of cholesterol, triglycerides, proteins, and phospholipid molecules. \n3. The lipoprotein particles are classified according to their density into HDL, LDL, and very-low-density lipoproteins (VLDL).','2023-09-22 07:49:34.077000','2023-09-22 07:49:54.932000','2023-09-22 07:49:54.926000',7,7,NULL,NULL),(12,'Sitaram Jindal Foundation Scholarship','Sitaram Jindal Foundation Scholarship is one of the renowned scholarships among students offered by Sitaram Jindal Foundation',NULL,'\"Scholarship Details:\nPostgraduation level students Rs.1800 per month for girls and Rs. 1500 per month for boys\n\nEligibility Criteria: The applicant ought to be enrolled in a master’s program.\nIn the most recent qualifying exam, male applicants needed to obtain a minimum score of 65%, and female applicants needed a minimum score of 60%.\nFor the Sitaram Jindal foundation scholarship, Karnataka students must receive at least 70% for boys and 65% for girls.\"','2023-09-27 07:40:00.958000','2023-10-07 20:19:17.078000','2023-09-27 07:40:02.968000',7,NULL,NULL,NULL),(13,'Data Analytics Manager','Lead data-driven decision-making at Axis My India Ltd., India\'s media powerhouse. Manage analytics for 16 Crore households nationwide, influencing advertising, marketing, and market research strategies.',NULL,'Job Description:\n\nTo effectively lead/coach team of Data Analytics Professionals\nTranslate business requirements and hypotheses into analyses and insights to aid business decision making\nConduct full lifecycle activities which includes project requirement, data collection, data cleaning, data- exploration/analysis, analytics, and client reporting.\nAbility to work with structured as well as unstructured data and derive meaningful insights.\nConceptualize KPIs to measure, track and benchmark performance in various aspects of business.\nCollaborate with internal stakeholders to manage data logistics (including data transfers, understanding data structures, business rules, business processes and problems etc.) for efficient project execution.\nIdentifying opportunities for continuous improvement and automation of tasks using Excel/Python/R/SQL where relevant.\nStrong experience in Business Intelligence, Data Analytics, Modelling and Segmentation.\nExperience in Visualization tools like Tableau / Power BI.\n\nRole: Data Analytics Manager\nIndustry Type: IT Services & Consulting\nDepartment: Data Science & Analytics\nEmployment Type: Full Time, Permanent\nEducation: UG: B.Tech/B.E, BCA in Computers, Any Postgraduate\nExperience Required: 5-8 years\nLocation: Mumbai','2023-09-27 12:25:43.612000','2023-09-27 12:51:14.329000','2023-09-27 12:47:28.194000',7,7,NULL,NULL),(14,'Data Analyst- Senior Associate','A career in National Special Functions, within Internal Firm Services, will provide you with the opportunity to support service, sector, and market leaders deliver the unique PwC client experience to our clients',NULL,'Job Description:\n\nPossessing deep SQL skills across multiple ETL and query tools\nLeveraging data analytics in understanding of business problems in the form of functional and technical requirements, and innovative thought leadership in data analysis\nCollaborating as a liaison between CDO, the xLoS (Line of Service) and IFS functions\nUtilizing knowledge of PwC s internal organization and processes\nUnderstanding of Data modeling and Schema Design principles\nUnderstanding of enterprise Conceptual, Logical and Physical data models (Enterprise Data Models)\nExperience profiling source data to ascertain how to map it to a target Enterprise Data Model\nExperience developing ETL pseudocode to be used by data engineers to integrate data sources to target systems\nCreating internal partnerships with key stakeholders\nBuilding, maintaining and utilizing networks of LoS and IFS functional staff networks\nMaintaining working relationships with stakeholders\nTranslating business requirements into a technical approach while working with technical project teams\n\nRole: Data Analyst\nIndustry Type: IT Services & Consulting\nDepartment: Data Science & Analytics\nEmployment Type: Full Time, Permanent\nRole Category: Business Intelligence & Analytics\nEducation: Any Graduate, Any Postgraduate\nExperience Required: 0-1 years\nLocation: New Delhi','2023-09-27 16:27:02.974000','2023-09-27 16:27:04.397000','2023-09-27 16:27:04.392000',8,8,NULL,NULL),(15,'Data Science Analyst',NULL,'DSA','\nAlthough no two days at Accenture are the same, as an Organizational Analytics (OA) Scientist in our Talent & Organization (