ertise in thyroid surgery, breast surgery, anal fissures, haemorrhoids, lap hernia surgery, open hernia surgery, surgery for varicose veins, lap appendectomy and many more.\n\nConsultation Information:\nTimings: Mon - Sat\n10:30 AM - 12:30 PM\nRatings: 89%','2023-10-18 06:42:31.172000','2023-10-18 08:04:51.701000','2023-10-18 06:42:32.830000',11,11,NULL,NULL),(29,'Dr Ravindra Mehta - Pulmonologist','Dr Ravindra Mehta is a Pulmonology and Respiratory Medicine specialist with 20 years of experience',NULL,'About the doctor: Dr Ravindra Mehta is a Pulmonology Respiratory Medicine Specialist with over 20 Yrs. years of experience and has the following qualifications -MBBS, MD (Gen. Med.)\nDr Ravindra Mehta offers online consultations and is available for physical consultations at  Apollo Hospitals Jayanagar,Bangalore\n\nConsultation Information:\nTimings: Mon - Fri\n12:00 PM - 3:00 PM\nRatings: 87%','2023-10-18 06:43:05.383000','2023-10-18 08:06:00.604000','2023-10-18 06:43:06.877000',11,11,NULL,NULL),(30,'Dr Anita Krishnan - ENT Specialist','Dr Anita has done MBBS, Diploma in Otorhinolaryngology (DLO), DNB - Otorhinolaryngology ENT/ Otorhinolaryngologist',NULL,'About the doctor: Dr. Anita Krishnan has Fellowships and Certifications in Recipient of the First Fellowship in Head and Neck Surgery Training. She was awarded by the Bangalore ENT Trust on 1 June 2004 - 30 November 2004. Research Fellow at the Kidwai Memorial Institute of Oncology and Bangalore Institute of Oncology, Bangalore\n\nConsultation Information:\nTimings: Mon - Fri\n09:00 AM - 6:00 PM\nRatings: 98%','2023-10-18 06:43:37.633000','2023-10-18 08:06:46.188000','2023-10-18 06:43:39.184000',11,11,NULL,NULL),(31,'Dr. Suresh G - General Physician/ Internal Medicine','Dr. Suresh G is a General Physician working at Apollo Clinic Bellandur, Bangalore. He has 25 years of experience in his field. ',NULL,'About the doctor: \nDr. Suresh G is a General Physician working at Apollo Clinic Bellandur, Bangalore. He has 25 years of experience in his field. He has done his MBBS and MD (General Medicine) from Kuvempu Univerisity, Karnataka (1990). Some of the services he provides are Viral Fever Treatment, Skin Allergies, Coronavirus Symptoms Treatment and Diabetes Management.\n\nConsultation Information:\nTimings: Mon - Sat\n8:00 AM - 7:00 PM\nRatings: 90%','2023-10-18 06:44:14.152000','2023-10-18 08:08:12.218000','2023-10-18 06:44:16.243000',11,11,NULL,NULL),(32,'Lipid Profile/Cholesterol Test','A Lipid Profile test, also known as a total cholesterol test, is done to measure the amount and type of fat in the blood.',NULL,'About the Test\nA Lipid Profile test, also known as a total cholesterol test, is done to measure the amount and type of fat in the blood. It measures low-density lipoprotein (LDL), high-density lipoprotein (HDL), and triglycerides in the body.. People with obesity, diabetes, a sedentary lifestyle, and a family history of high cholesterol or heart attacks should regularly get their lipid profile testing done. People undergoing treatment for high cholesterol and heart disease also require regular cholesterol testing to monitor the effectiveness of treatment, It is crucial to establish an accurate diagnosis of a lipid profile to proactively eliminate the risks of stroke or major cardiovascular diseases.\n\nTest preparation\n1. Fast for at least 10–12 hours before the test. Fasting means neither eating any food nor drinking coffee, tea, milk, tender coconut water or anything except water.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 8-9 hours\n\nParameters Considered\n1. The Lipid Profile test usually measures total cholesterol, HDL cholesterol, LDL cholesterol, and triglycerides levels. The other results that may be reported include derived VLDL cholesterol, derived non-HDL cholesterol, and total cholesterol to HDL cholesterol ratio.\n2.Cholesterol and triglycerides are essential lipids that are carried in the blood by lipoprotein particles made up of cholesterol, triglycerides, proteins, and phospholipid molecules. \n3. The lipoprotein particles are classified according to their density into HDL, LDL, and very-low-density lipoproteins (VLDL).','2023-10-18 08:16:03.497000','2023-10-18 08:16:57.356000','2023-10-18 08:16:57.350000',11,11,NULL,NULL),(33,'Complete Blood Count (CBC) Test','The complete blood count (CBC) test is one of the most commonly done blood tests. To understand this test, it is very important to know that blood consists of two major parts: primarily plasma and cellular elements.',NULL,'About the Test\nCBC test means complete blood count test. This is a test that measures all the characteristics of the cells in the blood. It comprises testing levels of red blood cells (RBCs), white blood cells (WBCs), and platelets. CBC test also measures the characteristics of the cells like haemoglobin (Hb) concentration and help in calculating other related values like haematocrit, mean corpuscular volume (MCV), Mean corpuscular haemoglobin concentration (MCHC).\n\nTest preparation\n1. Fasting is not required for CBC blood test. \n2. Prescription medications may be continued till the date of the test.\n3. Blood thinners, steroid supplements, immunosuppressants need to be stopped 48 hours prior to the test under medical guidance.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 6 hours\n\nParameters Considered\n1. Red Blood Cell (RBC) measurements:\n- RBC count\n- Haemoglobin\n- Haematocrit\n\n2. White blood Cell (WBC) measurements:\n- WBC count\n- Differential count\n\n3. Platelet Count\n\n4. Blood Indices:\n- Mean corpuscular volume\n- Mean corpuscular haemoglobin\n- Mean corpuscular haemoglobin concentration\n- Red cell distribution width','2023-10-18 08:29:36.427000','2023-10-18 08:36:57.911000','2023-10-18 08:29:38.099000',11,11,NULL,NULL),(34,'HbA1c (Glycosylated Haemoglobin) Test','The HbA1c test is used to measure the levels of blood sugar (glucose)',NULL,'About the Test\nThe HbA1c test is used to measure the levels of blood sugar (glucose) attached to haemoglobin over 3 months. This combination of haemoglobin and glucose is called HbA1c. Haemoglobin is a component of red blood cells (RBCs) that carries oxygen from the lungs to the whole body. In type 2 diabetes your blood glucose gets too high because your body doesn\'t make enough insulin to move blood sugar from your bloodstream into your cells, or because your cells stop responding to insulin. It is usually done once every three months because, typically, the lifespan of a red blood cell is 3 months.\n\nTest preparation\n1. Fasting is not required for an HbA1c (Glycosylated Haemoglobin) test.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 6 hours\n\nParameters Considered\n1. Percentage of glycosylated haemoglobin in the blood, which reflects the average blood glucose over the past two to three months (8–12 weeks).\n2. Haemoglobin is the protein that is found in red blood cells and is responsible for transporting oxygen. Of the different types of haemoglobin, haemoglobin A is the most predominant.\n3. Haemoglobin A1c is the dominant form of Glycosylated Haemoglobin. As RBCs die and are replaced, Haemoglobin A1c is cleared and slowly replaced with non-glycosylated haemoglobin. \n4. Measurement of HbA1c (Glycosylated Haemoglobin) level over some time gives an indication of the level of glucose in the blood over the specified period. This helps in the diagnosis of diabetes and is useful for monitoring the effectiveness of measures taken to reduce blood sugar levels.','2023-10-18 08:30:28.433000','2023-10-18 08:35:37.449000','2023-10-18 08:30:30.015000',11,11,NULL,NULL),(35,'Liver Function Test (LFT)','A Liver Function Test (LFT) includes a group of blood tests commonly performed to evaluate the function of the liver. ',NULL,'About the Test\nA Liver Function Test (LFT) includes a group of blood tests commonly performed to evaluate the function of the liver. These tests measure the levels of enzymes and proteins produced by the liver, including bilirubin, albumin, etc. It’s advised to take the test in case you show symptoms of liver problems, such as dark urine, diarrhoea, light stool, and jaundice.\n\nTest preparation\n1. Fasting is not required. However, your doctor may ask you to fast for 10 to 12 hours.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 6 hours\n\nParameters Considered\n1. Liver Function Tests measure the level of liver enzymes, proteins, and bilirubin in the blood.\n2. LFT is a group of tests that measure the levels of (SGOT) Aspartate Aminotransferase (AST), (SGPT) Alanine Aminotransferase (ALT), Alkaline Phosphatase (ALP), total protein, Bilirubin, and Gamma Glutamyl Transferase (GGT) in the blood.\n3. Liver function can also be affected by various risk factors like alcohol, certain drugs, a sedentary lifestyle, and obesity.\n4, Regular monitoring of liver function helps with the early detection of any liver abnormalities.','2023-10-18 08:31:16.435000','2023-10-18 08:34:44.516000','2023-10-18 08:31:17.891000',11,11,NULL,NULL),(36,'Thyroid Function Test (TFT)','Thyroid blood tests can help determine if hypothyroidism (too few thyroid hormones) or hyperthyroidism',NULL,'About the Test\nThe thyroid is a gland which is present in front of the throat over the Adam´s apple. It produces hormones thyroxine (T4) and triiodothyronine (T3). The thyroid gland is stimulated by a hormone called thyroid stimulating hormone (TSH) produced in the pituitary gland. T3 and T4 together are vital almost all the important functions of the most vital organs. TFT test means thyroid function test that measures the levels of these three hormones in the blood.\n\nTest preparation\n1. Fasting is not required.\n\nTest Details:\n1. Sample type: Blood\n2. Report Delivery: Get reports within 8 hours\n\nParameters Considered\nThe parameters tested in a TFT are:\n1. Thyroid Stimulating Hormone Test\n2. Thyroxine (T4) Test\n3. Triiodothyronine (T3) Test','2023-10-18 08:32:00.329000','2023-10-18 08:33:27.494000','2023-10-18 08:32:01.880000',11,11,NULL,NULL),(37,'DOLO (paracetamol) Tablet - 650mg','Paracetamol is used for pain relief and fever. It is used to relieve pain in conditions like headache, muscle pain, or dental pain.',NULL,'About the Product:\nMANUFACTURER- Micro Labs Ltd\nSALT COMPOSITION- Paracetamol (650mg)\nSALT SYNONYMS- Acetaminophen\nSTORAGE - Store below 30°C\n\nUses:\nDolo is used for pain relief and fever. It is used to relieve pain in conditions like headache, muscle pain, or dental pain.\n\nHow it works\nDolo 650 Tablet is an analgesic (pain reliever) and anti-pyretic (fever reducer). It works by blocking the release of certain chemical messengers that cause pain and fever.\n\nCommon side effects\nNausea, Vomiting, Insomnia (difficulty in sleeping), Headache, Constipation, Itching','2023-10-18 09:20:06.873000','2023-10-18 09:27:40.303000','2023-10-18 09:20:08.604000',11,11,NULL,NULL),(38,'Zintac 150mg Tablet','Zintac 150mg Tablet is a medicine that reduces the amount of acid your stomach makes.',NULL,'About the Product:\nMANUFACTURER - Nicholas Healthcare Limited\nSALT COMPOSITION - Ranitidine (150mg)\nSTORAGE- Store below 30°C\n\nUses:\nZintac 150mg Tablet is a medicine that reduces the amount of acid your stomach makes. It is used to treat and prevent heartburn, indigestion, and other symptoms caused by too much acid in the stomach. It is also used to treat and prevent stomach ulcers, reflux disease, and some rarer conditions.\n\nHow it works\nZintac 150mg Tablet is a histamine H2 receptor blocker that reduces the amount of acid made in the stomach. It relieves acid-related indigestion and heartburn.\n\nCommon side effects\nHeadache, Diarrhea, Gastrointestinal disturbance','2023-10-18 09:20:40.006000','2023-10-18 09:27:51.669000','2023-10-18 09:20:41.433000',11,11,NULL,NULL),(39,'Ecosprin-AV 75 Capsule','Ecosprin-AV 75 Capsule is a combination of two medicines used to prevent heart attack and stroke',NULL,'About the Product:\nMANUFACTURER- USV Ltd\nSALT COMPOSITION- Atorvastatin (10mg) + Aspirin (75mg)\nSTORAGE - Store below 30°C\n\nUses:\nEcosprin-AV 75 Capsule is a combination of two medicines used to prevent heart attack and stroke. It lowers the \"bad\" cholesterol (LDL), triglycerides and raises the \"good\" cholesterol (HDL) levels in the body. Moreover, it also decreases the formation of blood clots.\n\nHow it works\nEcosprin-AV 75 Capsule is a combination of two medicines: Atorvastatin and Aspirin, which prevents heart attack and stroke. Atorvastatin is a lipid-lowering medication that blocks an enzyme required in the body to make cholesterol. It lowers the \"bad\" cholesterol (LDL), triglycerides and raises the \"good\" cholesterol (HDL).\n\nCommon side effects\nAbdominal pain, Constipation, Flatulence, Increased liver enzymes, Hepatitis (viral infection of liver), Reye\'s syndrome like symptoms','2023-10-18 09:21:12.658000','2023-10-18 09:28:10.372000','2023-10-18 09:21:14.245000',11,11,NULL,NULL),(40,'Dazit 5mg Tablet','Dazit 5mg Tablet belongs to a group of medicines called antihistamines',NULL,'About the Product:\nMANUFACTURER- Sun Pharmaceutical Industries Ltd\nSALT COMPOSITION- Desloratadine (5mg)\nSTORAGE - Store below 30°C\n\nUses:\nDazit 5mg Tablet belongs to a group of medicines called antihistamines. It is used in the treatment of various allergic conditions. It relieves symptoms like itching, swelling and rashes.\n\nHow it works\nDazit 5mg Tablet is an antihistaminic medication. It treats allergy symptoms such as itching, swelling, and rashes by blocking the effects of a chemical messenger (histamine) in the body.\n\nCommon side effects\nSleepiness, Dizziness','2023-10-18 09:21:41.139000','2023-10-18 09:28:31.853000','2023-10-18 09:21:42.439000',11,11,NULL,NULL),(41,'Cheston Cold Tablet','Cheston Cold Tablet is used in the treatment of common cold symptoms ','CCT','About the Product:\nMANUFACTURER- Cipla Ltd\nSALT COMPOSITION - Cetirizine (5mg) + Paracetamol (325mg) + Phenylephrine (10mg)\nSTORAGE - Store below 30°C\n\nUses:\nCheston Cold Tablet is used in the treatment of common cold symptoms like runny nose, stuffy nose, sneezing, watery eyes, and congestion or stuffiness. It is also used to relieve pain and fever..\n\nHow it works\nCheston Cold Tablet is a combination of three medicines: Cetirizine, Paracetamol and Phenylephrine, which relieves common cold symptoms. Cetirizine is an antiallergic which blocks histamine (a chemical messenger) to relieve allergy symptoms like runny nose, watery eyes and sneezing. Paracetamol is an analgesic (pain reliever) and antipyretic (fever reducer). It blocks the release of certain chemical messengers in the brain that are responsible for pain and fever. Phenylephrine is a decongestant which narrows the small blood vessels providing relief from congestion or stuffiness in the nose.\n\nCommon side effects\nNausea, Vomiting, Headache, Fatigue, Dizziness, Dryness in mouth, Sleepiness, Allergic reaction','2023-10-18 09:22:11.269000','2024-01-04 20:45:09.802000','2023-10-18 09:22:12.846000',11,NULL,NULL,NULL),(42,'Fortis Hospital ','Fortis Hospital, Rajajinagar is a world-class medical center affiliated with Fortis group of Hospitals',NULL,'About the hospital: Fortis hospital focuses on providing outstanding patient care with national and internationally renowned physicians. Our outstanding facility has been offering the local people of Rajajinagar with a leading-edge medical hub since the last decade or so\n\n\nDetails of the hospital:\nOperational Timings: Open 24x7\nType of Hospital: Multi-speciality\nNumber of beds: 48','2023-10-18 10:08:39.388000','2023-10-19 08:12:03.570000','2023-10-18 10:08:41.790000',9,7,NULL,NULL),(43,'Sparsh Hospital','Sparsh hospital is now considered a one-stop destination for all diagnostic and treatment needs. Easily accessible via all modes of transport